import "./App.css";
import Login from "./pages/login/login";
import { BrowserRouter as Router, Route, Link, Routes } from "react-router-dom";
import Register from "./pages/register/register";
import EthicsProblemList from "./pages/ethicsProblem/ethicsProblemList";
import EthicsProblem from "./pages/ethicsProblem/ethicsProblem";
import { useState } from "react";

export const defaultUserInfo =
  // {
  //   id: -1,
  //   email: "",
  //   password: "",
  //   username: "",
  //   solvedCodingProblems: [],
  //   solvedEthicsProblems: [],
  // };

  {
    id: 0,
    email: "test@gmail.com",
    password: "test",
    username: "test",
    solvedCodingProblems: [1, 4, 5],
    solvedEthicsProblems: [0, 4, 9, 11],
  };

function App() {
  const [userInfo, setUserInfo] = useState(defaultUserInfo);

  const getUserInfo = () => {
    return userInfo;
  };

  const updateUserInfo = (newInfo) => {
    setUserInfo(newInfo);
  };

  return (
    <Router>
      <Routes>
        <Route
          path="/ethics/:pid"
          element={
            <EthicsProblem
              getUserInfo={getUserInfo}
              updateUserInfo={updateUserInfo}
            />
          }
        />
        <Route
          path="/ethics"
          element={
            <EthicsProblemList
              getUserInfo={getUserInfo}
              updateUserInfo={updateUserInfo}
            />
          }
        />
        <Route path="/register" element={<Register />} />
        <Route path="/" element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
